pragma solidity ^0.5.16;
pragma experimental ABIEncoderV2;

import "./SafeMath.sol";
import "./ElectToolbox.sol";
import "./ProvableAPI_0.5.sol";
//import "github.com/provable-things/ethereum-api/provableAPI_0.5.sol";


/**
 * @title Elect
 * 
 * 
 * Smart contract to elect a profile based on a set of objective criteria, and a QoS. 
 */


contract Elect is usingProvable {

    uint[] filter;

    string filteredIds;


    enum AvailabiltyState{ONEDAY, SEVERALDAYS}
    AvailabiltyState avState;

    uint[] candidate;

    // list of persons with attribute values:   
    // [[id, startDay, startMonth, startYear, endDay, endMonth, endYear, equipment1, equipment2, equipment3 //pickup, distance]]
    uint[][] candidates = [
                            [0, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [1, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [2, 1,1,21,  13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [3, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [4, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [5, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [6, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [7, 1,1,21,  13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [8, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10],
                            [9, 12,1,21, 13,1,21,  1,1, 10,3,3,10,3,3,10,3,3,10,3,10,3,3,10]
                        ];


    bool matchExists = false;
    string bestProfiles;

    //string alphas; 
    event BestCandidates(
        string ExistCandidates,
        string profiles  
    );

   //string public qosList_string;
   event LogConstructorInitiated(string nextStep);
   event LogQoSCompute(string qosList);
   event LogNewProvableQuery(string description);

    function getfilter() public view returns(uint[] memory){
        return filter;
    }

    function getCandidates() public view returns(uint[][] memory){
        return candidates;
    }

    function getBestProfiles() public view returns(string memory){
        return bestProfiles;
    }


    ///// FILTER /////

    function filterScan(uint[] memory attributes, uint[] memory availability) public payable returns (uint[] memory){
        // SET CLEAN FILTERING VARIABLES
        uint[] memory _filter = new uint[](candidates.length);
        for(uint i=0; i<candidates.length;i++){
            _filter[i]=0;
        }
        matchExists=false;

        // FILTER - TEST ALL CANDIDATES
        for(uint ind=0; ind<candidates.length; ind++){
            candidate.length = 0;
            candidate = candidates[ind];

            // CHECK ATTRIBUTES
            bool matchOnAttributes = true;
            uint index=0;
            uint filterMaxInd = 7 + attributes.length;

            for(uint id_att=7; id_att<filterMaxInd; id_att++){
                if((attributes[index]==1) && (candidate[id_att]!=1)){
                        matchOnAttributes=false;
                }
                index++;
            }

            // CHECK AVAILABILITY
            if(matchOnAttributes){
                if((availability.length==3)||
                    ((availability[0]==availability[3])&&(availability[1]==availability[4])&&(availability[2]==availability[5]))){ // ask for a day booking
                    avState = AvailabiltyState.ONEDAY;
                    _filter[ind]=ElectToolbox.oneDayAvailability(candidate, availability);
                }
                else{ 
                    //availability.length==6, ask for a several-days booking 
                    avState = AvailabiltyState.SEVERALDAYS;
                    _filter[ind]=ElectToolbox.severalDaysAvailability(candidate, availability);
                }

                if(_filter[ind] == 1){
                    matchExists=true;
                }
            }
        }

        filter = _filter;

        return filter;
    }


    ///// ORACLE

    function __callback(bytes32 myid, string memory result) public {
        if (msg.sender != provable_cbAddress()) revert();

        bestProfiles=result;

        // emit event
        emit BestCandidates(
            'Matching',
            bestProfiles
        );

    }

    function sort(uint[] memory attributes, uint[] memory availability, string memory alphas, uint num_alphas) public payable{

        filter = filterScan(attributes, availability);

        if(matchExists){
            /// compute qos via oracle
            if (provable_getPrice("URL") > address(this).balance) {
                emit LogNewProvableQuery("Provable query was NOT sent, please add some ETH to cover for the query fee");
            } else {
                emit LogNewProvableQuery("Provable query was sent, standing by for the answer..");
                string memory str_matrix = ElectToolbox.uintarrays2string(candidates,num_alphas);
                string memory str_filter = ElectToolbox.list2string(filter);
                string memory url= string(abi.encodePacked("https://qosapi.herokuapp.com/api/qos?matrix=", str_matrix, "&alpha=[", alphas,"]", "&filter=", str_filter));
                provable_query("URL",url);
            }
        }

        else{
            emit BestCandidates('No matching found', '');
        }
    }

}

